import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow'
import TableCell from '@material-ui/core/TableCell'


const headCells = [
    { 
        id: 'Sport', numeric: false, disablePadding: true, label: 'Sport' },
    { 
        id: 'Game_Type', numeric: false, disablePadding: false, label: 'Game_Type' },
    { 
        id: 'Entry_Key', numeric: true, disablePadding: false, label: 'Entry_Key' },
    { 
        id: 'Entry', numeric: false, disablePadding: false, label: 'Entry' },
    { 
        id: 'Contest_Key', numeric: false, disablePadding: false, label: 'Contest_Key' },
    { 
        id: 'Contest_Date_EST', numeric: false, disablePadding: false, label: 'Contest_Date_EST' },
    { 
        id: 'Place', numeric: true, disablePadding: false, label: 'Place' },
    { 
        id: 'Points', numeric: true, disablePadding: false, label: 'Points' },
    { 
        id: 'Winnings_Non_Ticket', numeric: true, disablePadding: false, label: 'Winnings_Non_Ticket' },
    { 
        id: 'Winnings_Ticket', numeric: true, disablePadding: false, label: 'Winnings_Ticket' },
    { 
        id: 'Contest_Entries', numeric: true, disablePadding: false, label: 'Contest_Entries' },

    { 
        id: 'Entry_Fee', numeric: true, disablePadding: false, label: 'Entry_Fee' },
    { 
        id: 'Prize_Pool', numeric: true, disablePadding: false, label: 'Prize_Pool' },
    { 
        id: 'Places_Paid', numeric: true, disablePadding: false, label: 'Places_Paid' }, 


    ]
    function descendingComparator(a, b, orderBy) {
        if (b[orderBy] < a[orderBy]) {
          return -1;
        }
        if (b[orderBy] > a[orderBy]) {
          return 1;
        }
        return 0;
      }

      function getComparator(order, orderBy) {
        return order === 'desc'
          ? (a, b) => descendingComparator(a, b, orderBy)
          : (a, b) => -descendingComparator(a, b, orderBy);
      }

      function stableSort(array, comparator) {
        const stabilizedThis = array.map((el, index) => [el, index]);
        stabilizedThis.sort((a, b) => {
          const order = comparator(a[0], b[0]);
          if (order !== 0) return order;
          return a[1] - b[1];
        });
        return stabilizedThis.map(el => el[0]);
      }

const DFSTableHead = () => {
    return(
        <TableHead>
          <TableRow>
            {/* <TableCell>Sport</TableCell>
            <TableCell align="right">Game_Type</TableCell>
            <TableCell align="right">Entry_Key</TableCell>
            <TableCell align="right">Entry</TableCell>
            <TableCell align="right">Contest_Key</TableCell>
            <TableCell align="right">Contest_Date_EST</TableCell>
            <TableCell align="right">Place</TableCell>
            <TableCell align="right">Points</TableCell>
            <TableCell align="right">Winnings_Non_Ticket</TableCell>
            <TableCell align="right">Winnings_Ticket</TableCell>
            <TableCell align="right">Contest_Entries</TableCell>
            <TableCell align="right">Entry_Fee</TableCell>
            <TableCell align="right">Prize_Pool</TableCell>
            <TableCell align="right">Places_Paid</TableCell> */}
            {headCells.map(headCell => (
          <TableCell
            key={headCell.id}
            align={headCell.numeric ? 'right' : 'left'}
            padding={headCell.disablePadding ? 'none' : 'default'}
            sortDirection={orderBy === headCell.id ? order : false}
          >
            <TableSortLabel
              active={orderBy === headCell.id}
              direction={orderBy === headCell.id ? order : 'asc'}
              onClick={createSortHandler(headCell.id)}
            >
              {headCell.label}
              {orderBy === headCell.id ? (
                <span className={classes.visuallyHidden}>
                  {order === 'desc' ? 'sorted descending' : 'sorted ascending'}
                </span>
              ) : null}
            </TableSortLabel>
          </TableCell>
        ))}
          </TableRow>
        </TableHead>
    )
}

export default DFSTableHead
